.home {
    .logo {
        background: white;
        height: 100px;
        width: 200px;
    }

    .info-section {
        padding: 54px;
        width: 35%;
        position: absolute;
        top: 0;
        bottom: 0;
        left: 0;

        .info-box {
            bottom: 60px;
            position: absolute;

            h4 {
                font-size: 1.2rem;
                color: $color3;
                margin: 0.7rem 0;
            }

            p {
                font-size: 0.9rem;
                font-weight: 300;
                color: $color3;
                margin: 0.2rem 0 1.5rem;

            }
        }
    }

    .content-area {
        margin-left: 35%;
        background: white;
        width: 65%;
        height: 100%;

        .img-container {
            width: 30%;
            display: inline-block;
            position: relative;
            height: 100%;

            .user-img {
                top: 56px;
                position: absolute;
                left: -250px;
                width: 500px;
                height: calc(100% - 112px);
                background: url("https://mediaslide-europe.storage.googleapis.com/named/pictures/279/1663/profile-1530193970-e8886fbd48fd79794127c8636f6cd804.jpg") no-repeat center center; 
                -webkit-background-size: cover;
                -moz-background-size: cover;
                -o-background-size: cover;
                background-size: cover;
            }
        }

        .profile-section {
            display: inline-block;
            vertical-align: top;
        }
    }
}

